import React from "react";
import s from './NewLineTable.module.css'

let NewLineTable = (props) => {
    let arr = []
    let data = props.data
    for (let key in data) {
        let a = (data[key])
        let addres = []
        if (key === 'phone') {
            arr.push(<td className={s.phone}>{a}</td>)
        }
        else if (key === 'address') {
            for (let add in a) {
                addres.push(<div>{add} : {a[add]}</div>)
            }
            arr.push(<td className={s.address}>{addres}</td>)
        } else {
            arr.push(<td className={s.column}>{a}</td>)
        }
        addres = []

    }
    return (
        <>
            {arr}
        </>
    )
}

export default NewLineTable
